import food from '../Resources/homepageBackground.jpeg';

   


export default function home() {
    return ( 
    
        <div className = "overlay">
            <div className= "home-container" style={{ backgroundImage: `url(${food})`, backgroundSize: "cover", height:"100vh", backgroundPosition:"center", opacity:0.9}}>

            <div className= "background">
                <div className = "middle-section"> 
                    <h1>Cookbook</h1>
                    
                    {/* <h1>Random Recipes</h1> */}
                </div>
                <div className="bottom-middle">
                    <p>Change your mood with food</p>
                </div>
            </div>
            
                <div>
                    <Nav/> 
                </div>
            </div>
        </div>
        
       
    )
}

        


